import Carousel from 'flat-carousel';

const images = [
    { src: 'src/img/nl_logo.png' }
];


function Carrossel(){
    return (
        <Carousel>
        {images.map((image, index) => (
            <div
                key={index}
                className="demo-item"
                style={{ backgroundImage: 'url(' + image.src + ')' }}
            />
        ))}
    </Carousel>
    );
}

export default Carrossel;
